import struct

def hex_to_arr(hex_string): 
    # Convert hex string to bytes
    byte_array = bytes.fromhex(hex_string)
    # Unpack bytes into a list of floats
    return list(struct.unpack('f' * (len(byte_array) // 4), byte_array))

